import React from "react";
import { withRouter } from "react-router";
class Home extends React.Component {
  componentDidMount() {
    setTimeout(() => {
      this.props.history.push("/todo");
    }, 5000);
  }
  render() {
    // console.log(">>> Check props", this.props);
    return (
      <div>
        Nếu bạn cần tạo đoạn văn tự động có nội dung phức tạp hoặc cần tùy chỉnh
        nhiều hơn, bạn có thể sử dụng một số extension như "Lorem Ipsum" hoặc
        "Auto-Open Markdown Preview" để tạo và thêm nội dung tự động vào tệp của
        bạn. Để cài đặt extension trong VS Code, hãy mở mục Extensions
        (Ctrl+Shift+X), tìm kiếm tên extension và bấm nút Install. Theo hướng
        dẫn của extension, bạn có thể sử dụng chúng để tự động tạo nội dung hoặc
        đoạn văn tự động trong tệp của bạn.
      </div>
    );
  }
}
export default withRouter(Home);
